const StarshipImage = [{
  name: `CR90 corvette`,
  description: `A versatile starship, the CR90 was used extensively across the galaxy by governments and private interests. The interior of the CR90 featured a modular design to allow for easy reconfiguration of the Corellian corvette from one function to another. Some older model corvettes, like the CR70, could easily be upgraded with retrofit packages like the Vanguard c20 to become CR90s.`,
  starshipImgSrc: `https://static.wikia.nocookie.net/starwars/images/2/24/TantiveIV-TSWB.png`
}, {
  name: `Star Destroyer`,
  description: `The wedge-shaped Imperial Star Destroyer is a capital ship bristling with weapons emplacements. Turbolasers and tractor beam projectors dot its surface. Its belly hangar bay can launch TIE fighters, boarding craft, land assault units, hyperspace probes, or be used to hold captured craft. In the days of the Empire, its bustling bridge would be staffed by the finest crewers in the Imperial starfleet. Its presence in a system mark matters of extreme Imperial import. Though, as is typical of the Empire, not even the Star Destroyer was enough to sate the Imperial hunger for displays of power. Larger vessels, such as the Super Star Destroyer, dwarf even these giants.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/Star-Destroyer_ab6b94bb.jpeg`
}, {
  name: `Sentinel-class landing craft`,
  description: `Designed by Sienar Fleet Systems, the Sentinel-class shuttle was a larger-scale troop transport used by the Empire. Much like its cousin, the Lambda-class shuttle, these vehicles featured three wings in a triangular layout: a stationary center foil and two articulated flanking wings. Imperials used the shuttle for missions that spanned the galaxy, from a search for droids on Tatooine to conflicts with the Lothal rebels.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/Imperial-Sentinel-Class-Shuttle_a2dc7d3b.jpeg`
}, {
  name: `Death Star`,
  description: `The Death Star was the Empire’s ultimate weapon: a moon-sized space station with the ability to destroy an entire planet. But the Emperor and Imperial officers like Grand Moff Tarkin underestimated the tenacity of the Rebel Alliance, who refused to bow to this technological terror…`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/Death-Star-I-copy_36ad2500.jpeg`
}, {
  name: `Millennium Falcon`,
  description: `An extensively modified Corellian light freighter, the Millennium Falcon is a legend in smuggler circles and is coveted by many for being the fastest hunk of junk in the galaxy. Despite her humble origins and shabby exterior, the ship that made the Kessel Run in less than 12 parsecs has played a role in some of the greatest victories of the Rebel Alliance and the New Republic. The Falcon looks like a worn-out junker, but beneath her hull she’s full of surprises. A succession of owners, including Lando Calrissian and Han Solo, have made special modifications that boosted the freighter’s speed, shielding and firepower to impressive – and downright illegal – levels. The price of such tinkering? The Falcon can be unpredictable, with her hyperdrive particularly balky. Despite her flaws, she’s beloved by her owners – Han Solo and Chewbacca spent years searching the galaxy for the ship they once called home, rejoicing when they finally reclaimed her.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/millennium-falcon-main-tlj-a_7cf89d3a.jpeg`
}, {
  name: `Y-wing`,
  description: `The Y-wing is a workhorse starfighter has been in use since the Clone Wars. Used for dogfights and for bombing runs against capital ships and ground targets, Y-wings are often overshadowed by newer models such as the X-wing and the A-wing. But the Y-wing's historical importance is remarkable, and it has reliably served multiple generations of star pilots.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/Y-Wing-Fighter_0e78c9ae.jpeg`
}, {
  name: `X-wing`,
  description: `The X-wing is a versatile Rebel Alliance starfighter that balances speed with firepower. Armed with four laser cannons and two proton torpedo launchers, the X-wing can take on anything the Empire throws at it. Nimble engines give the X-wing an edge during dogfights, and it can make long-range jumps with its hyperdrive and its astromech droid co-pilot. Luke Skywalker is famous for destroying the Death Star behind the controls of an X-wing.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/X-Wing-Fighter_47c7c342.jpeg`
}, {
  name: `TIE Advanced x1`,
  description: `Darth Vader piloted this distinctive experimental TIE fighter above the first Death Star, using its blaster cannons and his uncanny abilities with the Force to blast Rebel starfighters into glittering fragments.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/vaders-tie-fighter_8bcb92e1.jpeg`
}, {
  name: `Executor`,
  description: `The mighty flagship of Darth Vader, the Executor led Death Squadron during the Empire’s assault on Hoth and pursued the Millennium Falcon to Bespin, where Luke Skywalker and his friends narrowly escaped her tractor beams. First commanded by Admiral Ozzel and later by Admiral Piett, the massive warship met her end during the Battle of Endor, when a rebel A-wing smashed through her command bridge. Out of control, the Executor careened into the Death Star and exploded.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/databank_executor_01_169_8157df82.jpeg`
}, {
  name: `Rebel transport`,
  description: `A military version of a civilian transport, the GR-75 proved critical to the rebel retreat from Hoth, as starfighters protected personnel and equipment evacuating aboard these minimally armed craft. The GR-75’s clamshell-like outer hull offers protection for its interior, which can be filled with cargo pods.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/gr-75-medium-transport_cd04862d.jpeg`
}, {
  name: `Slave 1`,
  description: `A powerful pursuit craft made famous by Jango Fett in the days of the Republic, this ship was inherited by Boba Fett for his career as a bounty hunter. The aged but effective ship is loaded with hidden defensive and offensive weaponry and equipment, and has a reputation earned from decades of successfully capturing fugitives.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/slave-1-main_81d5c1c7.jpeg`
}, {
  name: `Imperial shuttle`,
  description: `An elegant example that stands apart from typical brutish Imperial engineering, the Lambda-class shuttle is a multi-purpose transport used in the Imperial starfleet. The Empire pressed the shuttle into service for both cargo ferrying and passenger duty. Even the Empire's elite, like Darth Vader and the Emperor Palpatine used these shuttles. It has three wings: a stationary center foil and two articulated flanking wings. When in flight, the side wings fold out for greater stabilization. When landing, the wings fold in, shrinking the vessel's silhouette.The well-armed vessel has two forward-facing double laser cannons, two wing-mounted double cannons, and a rear-facing double laser cannon. It is equipped with a hyperdrive.`,
  starshipImgSrc: `https://lumiere-a.akamaihd.net/v1/images/veh_ia_1752_040381b2.jpeg`
